import {
    gymbg,
    pianobg,
    allactbg,
    noactbg
} from '../../jss/masterStyle.js';

const dashboardStyle = theme => ({
    container: {
        padding: "20px",
    },
    paperCalendar: {
        padding: "0px",
        textAlign: "center",
        height: "400px",
    },
    calTitle: {
        paddingTop: "30px",
    },
    statTitle:{
        textAlign: "center",
        paddingLeft: "35%",
        paddingTop: "3%",
        fontWeight: "bold"
    },
    noActBackground:{
        padding: "0px",
        textAlign: "center",
        height: "150px",
        background: `linear-gradient(to right, transparent, white), url(${noactbg})`,
        backgroundSize: "40% 100%",
        backgroundRepeat: "no-repeat"
    },
    allActBackground:{
        padding: "0px",
        textAlign: "center",
        height: "150px",
        background: `linear-gradient(to right, transparent, white), url(${allactbg})`,
        backgroundSize: "40% 100%",
        backgroundRepeat: "no-repeat",
        animationName: "example",
        animationDuration: "4s"
    },
    gymBackground:{
        padding: "0px",
        textAlign: "center",
        height: "150px",
        background: `linear-gradient(to right, transparent, white), url(${gymbg})`,
        backgroundSize: "40% 100%",
        backgroundRepeat: "no-repeat"
    },
    pianoBackground:{
        padding: "0px",
        textAlign: "center",
        height: "150px",
        background: `linear-gradient(to right, transparent, white), url(${pianobg})`,
        backgroundSize: "40% 100%",
        backgroundRepeat: "no-repeat"
    },
    '@keyframes example': {
        '0%':  {
            backgroundColor:'red',
            left:'0px', 
            top:'0px',
        },
        '50%':  {
            backgroundColor:'blue',
            left:'200px', 
            top:'200px',
        },
        '50%':  '{background-color:blue; left:200px; top:200px;}'
    }
});

export default dashboardStyle;
